import React from "react";
import { Link } from "react-router-dom";

function Footer() {
  return (
    <div>
      <nav className="flex border-2 border-purple-500 m-2 space-x-2">
        <h4 className="flex-auto basis-1/6 border-2 border-orange-500">Home</h4>
        <Link to="/search">
          <h1 className="flex-auto basis-1/3 border-2 border-orange-500">
            Search
          </h1>
        </Link>
        <h4 className="flex-auto basis-1/3 border-2 border-orange-500">Box</h4>
        <h4 className="flex-auto basis-1/6 border-2 border-orange-500">
          Login
        </h4>
      </nav>
    </div>
  );
}

export default Footer;
